import "./reserveTutorscr.css"


import { useState, useMemo, useEffect } from 'react';
import axios from 'axios';

function ReserveTutorPage() {
  const [data, setData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios.get('https://x4g0ddpp1f.execute-api.us-east-2.amazonaws.com/prod/show/reservations');
      setData(result.data.body);
    };
    fetchData();
  }, []);

  const columns = useMemo(
    () => [
      {
        Header: 'ID',
        accessor: 'id',
      },
      {
        Header: 'Date',
        accessor: 'date',
      },
      {
        Header: 'Tutor',
        accessor: 'tutor',
      },
      {
        Header: 'Date',
        accessor: 'date',
      },
    ],
    []
  );

  return (
    <div>
      <h1>Reservations</h1>
      <table>
        <thead>
          <tr>
            {columns.map((column) => (
              <th key={column.accessor}>{column.Header}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          {data.map((row) => (
            <tr key={row.id}>
              {columns.map((column) => (
                <td key={column.accessor}>{row[column.accessor]}</td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default ReserveTutorPage;
